class Lista:
  def __init__(self):
    self.myList=[]

seradesta=Lista()
class Node:
  def __init__(self, state, parent, g, tickets,h):
    self.state=state
    self.parent=parent
    self.tickets=tickets
    self.g=g
    self.h=h
    self.f=h+g
  
  def getTickets(self):
    return self.tickets

  
  def setParent(self, parent):
    self.parent=parent
  
  def getParent(self):
    return self.parent
  
  def setG(self, g):
    self.g=g

  def getG(self):
    return self.g
  
  def getF(self):
    return self.f
  
  def setH(self,h):
    self.h=h
  
  def getH(self):
    return self.h

  def setF(self):
    self.f=self.g+self.h
  
  def getState(self):
    return self.state

class State:
  def __init__(self,pos,goal,trans):
    self.pos=pos
    self.trans=trans
    self.goal=goal
    
  
  def setPos(self, lst):
    self.pos=lst
  
  def getPos(self):
    return self.pos
  
  def getTrans(self):
    return self.trans
  
  

class SearchProblem:

  def __init__(self, goal, model, auxheur = []):
    self.goal=goal
    self.model=model
    self.auxheur=auxheur
  
    


  def search(self, init, limitexp = 2000, limitdepth = 10, tickets = [math.inf,math.inf,math.inf],anyorder=False):
    seradesta.myList=[]
    n_agentes=len(init)
    initState=State(init,self.goal,[])
    new_h=0
    for i in range(len(init)):
      new_h=new_h+heuristics[self.goal[i]][init[i]]
    InitNode=Node(initState,None,0,tickets,new_h)
    openList=[InitNode]
    searchSolution(n_agentes,InitNode,openList,self.goal,self.model,limitdepth,anyorder)
      
    return seradesta.myList

def searchSolution(nagente,node,openList,goal,model,limitdepth,anyorder):
  verify=stateFinal(node,goal,anyorder)
  if(verify==True):
    iterNode=node
    while(iterNode.getParent()!=None):
        seradesta.myList=seradesta.myList+[[iterNode.getState().getTrans(),iterNode.getState().getPos()]]
        iterNode=iterNode.getParent()
    seradesta.myList=seradesta.myList+[[iterNode.getState().getTrans(),iterNode.getState().getPos()]]
    seradesta.myList.reverse()
    return
  state=node.getState().getPos()
  lstaux=[]
  
  tickets=node.getTickets()
  if(nagente==3):
    for i in state:
      lstaux=lstaux+[model[i]]
    lstaux=list(product(*lstaux))     #cria todas as combinacoes possiveis
    listFinal = []
    for i in lstaux:
      listFinal=listFinal+[list(i)]  #converte os tuplos para lista para depois se poder eliminar o elemnto
    
    
    listFinal=eliminateStates(listFinal)  #elimina estados onde pelo menos 2 policias vao para o mesmo vertice
    
    
  else:
    listFinal = []
    for i in model[state[0]]:
      listFinal.append([i])
    
  if (tickets[0] != math.inf):
    listFinal=eliminateTickets(tickets,listFinal)
  
  openList.remove(node)
  for el in listFinal:
    pos=[]
    transport = []
    tic = node.getTickets()
    tickets = tic.copy()
    for element in el:
      pos=pos+[element[1]]
      transport = transport + [element[0]]  
      tickets[element[0]] = tickets[element[0]] - 1 #lista de tickets utilizada
    state=State(pos,goal,transport)
    new_g=node.getG() + 1
    max_h=new_h=heuristics[goal[0]][pos[0]]
    for iterator in range(len(pos)):
      new_h=heuristics[goal[iterator]][pos[iterator]]
      if(new_h>max_h):
        max_h=new_h
    if(new_g<=limitdepth):
      nNode = Node(state, node, new_g, tickets,max_h)
      openList.append(nNode)
      verify=stateFinal(nNode,goal,anyorder)
      if(verify==True):
        iterNode=nNode
        while(iterNode.getParent()!=None):
          seradesta.myList=seradesta.myList+[[iterNode.getState().getTrans(),iterNode.getState().getPos()]]
          iterNode=iterNode.getParent()
        seradesta.myList=seradesta.myList+[[iterNode.getState().getTrans(),iterNode.getState().getPos()]]
        seradesta.myList.reverse()
        return
    
  if(openList==[]):
    seradesta.myList=[]
    return
  minimo = openList[0].getF()
  minNode = openList[0]
  for nodeEval in openList:
    if (nodeEval.getF() < minimo):
      minNode = nodeEval
      minimo=nodeEval.getF()
  
  
  
  searchSolution(nagente,minNode,openList,goal,model,limitdepth,anyorder)

  

                 #elimina estados se nao houver bilhetes suficientes
def eliminateTickets(tickets,lst):
  z = 0
  while z<len(lst):
    auxTickets = tickets.copy()
    flag = 0
    for element in lst[z]:
      if(auxTickets[element[0]] > 0):
        auxTickets[element[0]] =  auxTickets[element[0]] - 1
      else:
        del lst[z]
        flag = 1
        break
    if (flag == 0):
      z = z + 1
  return lst

def eliminateStates(lstComb):
  z=0
  while z<len(lstComb):
      flag=0
      i=lstComb[z]
      for j in range(len(i)):
        for k in range(len(i)):
            if (k==j):
                continue
            else:
                if(i[k][1]==i[j][1]):
                    del lstComb[z]
                    flag=1
                    break

        if(flag==1):
          break
      if(flag == 0):
        z=z+1
          
                  
  return lstComb


def stateFinal(node,goal,anyorder):
  if(anyorder==False):
    if(node.getState().getPos()==goal):
      return True
    else:
      return False
  else:
    lst=list(permutations(goal))
    listFinal = []
    for i in lst:
      listFinal=listFinal+[list(i)] 
    if((node.getState().getPos() in listFinal)):
      return True
    else:
      return False
  
